function enable_sendmail(a){
    if(!enable_sendmail.enabled){
        enable_sendmail.enabled=true
    }
    $("#sendmail").click(function(b){
        b.preventDefault();
        if($("#sortable_table tbody :checkbox:checked").length>0){
            tb_show($(this).attr("title"),$(this).attr("href"),false);
            $(this).blur();
        }else{
            alert(a);
        }
    });
}enable_sendmail.enabled=false;

function enable_sendsms(a,c){
    if(!enable_sendsms.enabled){
        enable_sendsms.enabled=true;
    }    
    $("#sendsms").click(function(b){
        b.preventDefault();
        if($("#sortable_table tbody :checkbox:checked").length === 1){
            tb_show($(this).attr("title"),$(this).attr("href"),false);            
            $(this).blur();
        }else if($("#sortable_table tbody :checkbox:checked").length>1){           
            alert(c);
        }else{
            alert(a);
        }
    });
}enable_sendsms.enabled=false;
